module.exports = parseCookie = async ({params}) => {
	// Extract index and pfcookie from params
  const { index, pfcookie } = params;

  // Parse pfcookie as JSON
  const parsedCookie = JSON.parse(pfcookie);

  // Extract the cookie header
  const cookieHeader = parsedCookie['set-cookie'][index];

  // Split the cookie string to get the desired cookie
  const cookieParts = cookieHeader.split(';');
  const pfCookie = cookieParts[index];

  // Extract the value of the PFCookie
  const pfCookieValue = pfCookie.split('=')[1];

  // Return the PFCookie value
  return { "pfCookieValue": pfCookieValue };
}

